local guitarIndex = 0
local pianoIndex = 0

concommand.Add("vmidi_guitar_play", function(ply, cmd, args)
    local key = args[1]
    local tbl = util.JSONToTable(VMidi.Songs[key] or "")

    if (not tbl) then
        return
    end

    PrintTable(tbl)

    guitarIndex = guitarIndex + 1

    local index = guitarIndex

    for k, v in pairs (tbl) do
        timer.Simple(v.time * 0.0015, function()
            if (guitarIndex != index) then
                return
            end

            local wep = LocalPlayer():GetActiveWeapon()
            if (IsValid(wep) and wep:GetClass() == "velkon_guitar") then
                local note = 90 - v.note * 0.5

                local ang = LocalPlayer():EyeAngles()
                LocalPlayer():SetEyeAngles(Angle(math.Clamp(note, -90, 90), ang.y, ang.r))
                
                print("note: "..tostring(note))

                wep:PrimaryAttack()
            end
        end)
    end
end,
function()
    local tbl = {}

    for k, v in pairs (VMidi.Songs) do
        table.insert(tbl, "vmidi_guitar_play "..k)
    end

    return tbl
end)

concommand.Add("vmidi_guitar_stop", function()
    guitarIndex = guitarIndex + 1
end)

local pianoNotes = {
    [0] = {"a", 1},
    [1] = {"b", 1},
    [2] = {"a", 2},
    [3] = {"b", 2},
    [4] = {"a", 3},
    [5] = {"a", 4},
    [6] = {"b", 3},
    [7] = {"a", 5},
    [8] = {"b", 4},
    [9] = {"a", 6},
    [10] = {"b", 5},
    [11] = {"a", 7},
}

concommand.Add("vmidi_piano_play", function(ply, cmd, args)
    local key = args[1]
    local speed = tonumber(args[2] or 1)
    local pitchOffset = tonumber(args[3] or 0)

    local tbl = util.JSONToTable(VMidi.Songs[key] or "")

    if (not tbl) then
        return
    end

    PrintTable(tbl)

    pianoIndex = pianoIndex + 1

    local index = pianoIndex

    for k, v in pairs (tbl) do
        timer.Simple(v.time * 0.0015 / speed, function()
            if (pianoIndex != index) then
                return
            end

            local veh = LocalPlayer():GetVehicle()
            local piano = IsValid(veh) and veh:GetParent()
            if (IsValid(piano)) then
                piano = piano:GetParent()
            end

            if (IsValid(piano) and piano.OnRegisteredKeyPlayed) then
                local num = v.note - 12 * (2 + pitchOffset)
                local id = num % 12
                local mul = math.floor(num / 12)
                local val = pianoNotes[id]
        
                local note = val[1]..(val[2] + (mul * (val[1] == "a" and 7 or 5)))

                piano:OnRegisteredKeyPlayed(note)
            end
        end)
    end
end,
function()
    local tbl = {}

    for k, v in pairs (VMidi.Songs) do
        table.insert(tbl, "vmidi_piano_play "..k)
    end

    return tbl
end)

concommand.Add("vmidi_piano_stop", function()
    pianoIndex = pianoIndex + 1
end)